import React from 'react';
import './App.css';

// 2 data types

//products
const fetchedProducts = [
  {id: 1, name: "Name", thumbnail: ""}
]

//stockEvents

const fetchedStockEvents = [
  {id: 1, type: 'add | remove', qty: 1, product: fetchedProducts[0]} //type: 'add' || 'remove'
]

//Fetch all stock evenets

//separate by different products

//display them

function ExampleComponent(props) {
  console.log("ExampleComponent props", props)
  const productName = props.products[0].name
  console.log("ExampleComponent productName", productName)
  return(
    <p>I am the example</p>
  )
}


function App() {
  return (
    <div className="App">
      <ExampleComponent products={fetchedProducts} 
      stockEvents={fetchedStockEvents} 
      />
    </div>
  );
}

export default App;
